Ops.Gl.ImageCompose.LensDirt_v2 = function()
{
CABLES.Op.apply(this,arguments);
const op=this;
const attachments=op.attachments={"lensDirt_frag":"IN vec2 texCoord;\nUNI sampler2D tex;\nUNI float uOffsetX;\nUNI float uOffsetY;\nUNI float uZoom;\n// UNI int uIterations;\nUNI int uRandomSeed;\nUNI float uSpotEdge;\nUNI float uGamma;\nUNI float uAspect;\nUNI float amount;\n\n{{CGL.BLENDMODES3}}\n\n// https://www.shadertoy.com/view/MdfBRX\nfloat Bokeh(vec2 p, vec2 sp, float size, float mi, float blur)\n{\n    float d = length(p - sp);\n    float c = smoothstep(size, size*(1.-blur), d);\n    c *= mix(mi, 1., smoothstep(size*.8, size, d));\n    return c;\n}\n///  2 out, 2 in... from https://www.shadertoy.com/view/4djSRW\n//stable\nvec2 hash22(vec2 p)\n{\n\tvec3 p3 = fract(vec3(p.xyx) * vec3(.1031, .1030, .0973));\n    p3 += dot(p3, p3.yzx+33.33);\n    return fract((p3.xx+p3.yz)*p3.zy)*2.0-1.0;\n\n}\nvec3 dirt(vec2 uv, float n,float density,float hardness)\n{\n    n *= density;\n    vec2 p = fract(uv * n);\n    vec2 st = (floor(uv * n) + 0.5) / n;\n    vec2 rnd = hash22(st);\n    float c = Bokeh(p, vec2(0.5, 0.5) + vec2(0.3) * rnd, 0.2,\n                    abs(rnd.y * 0.35) + 0.3, 0.25 + rnd.x * rnd.y * hardness);\n\n    return vec3(c) * exp(rnd.x * 4.0);\n}\n\nvoid main()\n{\n\tvec3 di = vec3(1.0);\n    float edgeHardness = 0.1;\n    edgeHardness = clamp(uSpotEdge*0.25,0.0,0.2);\n\n    vec2 uv = (texCoord-0.5);\n\n    uv.y/=uAspect;\n    uv *= uZoom;\n    uv -= vec2(uOffsetX,uOffsetY);\n\n    float q = 0.0;\n    for (int i = 1; i < ITERATIONS ; i++)\n    {\n        q = float(i);\n        vec2 h=hash22(vec2(q)+vec2(uRandomSeed));\n        di += dirt(uv-h, h.x, 1.0, edgeHardness);\n    }\n\n    di = pow(di* 0.01,vec3(uGamma));\n    vec4 col = vec4(di,1.0);\n    vec4 base = texture(tex,texCoord);\n\n    outColor = cgl_blendPixel(base,col,amount);\n}",};
const
    render = op.inTrigger("render"),
    blendMode = CGL.TextureEffect.AddBlendSelect(op, "Blend Mode", "normal"),
    amount = op.inValueSlider("Amount", 1),
    maskAlpha = CGL.TextureEffect.AddBlendAlphaMask(op),
    offsetX = op.inFloat("Offset X", 0),
    offsetY = op.inFloat("Offset Y", 0),
    zoom = op.inFloat("Zoom", 5),
    iterations = op.inInt("Iterations", 50),
    randomSeed = op.inInt("Seed", 1),
    spotEdge = op.inFloatSlider("Spot edge", 0.5),
    gamma = op.inFloat("Gamma", 0.75),
    trigger = op.outTrigger("trigger");

const cgl = op.patch.cgl;
const shader = new CGL.Shader(cgl, op.name, op);

shader.setSource(shader.getDefaultVertexShader(), attachments.lensDirt_frag);

const
    textureUniform = new CGL.Uniform(shader, "t", "tex", 0),
    offsetXUniformX = new CGL.Uniform(shader, "f", "uOffsetX", offsetX),
    offsetXUniformY = new CGL.Uniform(shader, "f", "uOffsetY", offsetY),
    zoomUniform = new CGL.Uniform(shader, "f", "uZoom", zoom),
    // iterationsUniform=new CGL.Uniform(shader,'i','uIterations',iterations),
    randomSeedUniform = new CGL.Uniform(shader, "i", "uRandomSeed", randomSeed),
    spotEdgeUniform = new CGL.Uniform(shader, "f", "uSpotEdge", spotEdge),
    gammaUniform = new CGL.Uniform(shader, "f", "uGamma", gamma),
    uniformAspect = new CGL.Uniform(shader, "f", "uAspect", 1.0),

    amountUniform = new CGL.Uniform(shader, "f", "amount", amount);

CGL.TextureEffect.setupBlending(op, shader, blendMode, amount, maskAlpha);

iterations.onChange = updateIterations;
updateIterations();

function updateIterations()
{
    let its = iterations.get();
    its = Math.min(300, Math.max(1, its));
    shader.define("ITERATIONS", its);
}

render.onTriggered = function ()
{
    if (!CGL.TextureEffect.checkOpInEffect(op, 3)) return;

    cgl.pushShader(shader);
    cgl.currentTextureEffect.bind();

    uniformAspect.setValue(cgl.currentTextureEffect.getCurrentSourceTexture().width / cgl.currentTextureEffect.getCurrentSourceTexture().height);
    cgl.setTexture(0, cgl.currentTextureEffect.getCurrentSourceTexture().tex);

    cgl.currentTextureEffect.finish();
    cgl.popShader();

    trigger.trigger();
};


};

